&nbsp;...возможность получать новые профессии прямо на рабочем месте. 
  В связи с запуском нового банковского проекта мы открываем вакансию <b>Java developer.</b> 
  СТЕК ТЕХНОЛОГИЙ: 
  
 Java 8-11;  
 Tomcat, Jetty, Netty, Spring;  
 PostgreSQL, Oracle, Redis, Kafka, Tarantool;...&nbsp;

&nbsp;...проведение кодревью;  
 Активное участие в развитии команды.  
  Требования: 
  
 Опыт профессиональной/коммерческой разработки на <b>Java/</b>Spring/SpringBoot от 1 лет;  
 Умение конструктивно аргументировать свою позицию и адекватно реагировать на аргументы коллег;...&nbsp;

&nbsp;...работу по новым функциям интернет-банкинга, также доработка существующего функционала.
Требования:
Коммерческий опыт разработки на <b>Java </b>от 2 лет;
Опыт использования Spring, Hibernate, Gradle, JMS, JAX-WS, Jenkins, UML, Junit;
Опыт работы с микросервисной архитектурой;...&nbsp;

&nbsp;...Использовать и совершенствовать существующие решения, а также разрабатывать новые.  
  Мы ждем от тебя: 
  
 Опыт разработки приложений на <b>Java;</b>  
 Опыт разработки клиентов веб-сервисов;  
 Опыт парсинга документов (pdf, xls, xml, html) 
 Опыт работы с Selenium Framework...&nbsp;

&nbsp;...отклике укажите примеры проектов и функционал который вы реализовали. 
  Вы нам подходите, если у вас есть: 
  
 3+ лет опыта работы с <b>Java;</b>   
  опыт разработки приложений на Spring Framework;   
  хорошее понимание принципов работы баз данных RDBMS;   
